import React from 'react';
import Infobox from '../Components/Infobox';
import Vents from '../Components/Vent';
import Dail from '../Components/Dial';
import ControlButtons from '../Components/ControlButton';

type TitleBoxProps = {
    SectionTitle: string;
};

const TitleDesign = {
    color: '#122701',
    fontFamily: 'Inter',
    fontSize: '8px',
    fontStyle: 'normal',
    fontWeight: 600,
    lineHeight: '9px',

};

function TitleBox({ SectionTitle }: TitleBoxProps) {
    const uppercasedTitle = SectionTitle.toUpperCase();
    return (
        <div>
            <h1 style={TitleDesign}>
                {uppercasedTitle}
            </h1>
        </div>
    );
}

function Main() {
    return (
        <>
            <div className='Info-area'>
                <Infobox />
                <Infobox />
            </div>
            <TitleBox SectionTitle='Vents' />
            <Vents/>
            <TitleBox SectionTitle='Temps' />
            <Dail/>
            <TitleBox SectionTitle='Controls' />
            <div className='control-button-area'>
                <ControlButtons />
                <ControlButtons />
                <ControlButtons />
                <ControlButtons />
            </div>

        </>
    );
}

export default Main;
